import { FcLike } from "react-icons/fc";

const Card = ({course}) => {
  return (
    <div className="w-[300px] bg-bgDark rounded-md overflow-hidden text-white">
      <div>
        <img className="relative" src={course?.image?.url} alt="" srcset="" />
        <button className=" bg-white absolue w-[20px] h-[20px] rounded-full rig"> <FcLike/> </button>
      </div>
      <div className="course-info">
        <h4 className="course-head">{course?.title}</h4>
        <p className="course-para">{course?.description}</p>
      </div>
    </div>
  )
}

export default Card
